import React from 'react';
import Navigation from './components/navigation';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

const navLinks = [
  {
      title: 'Home',
      path: '/'
  },
  {
      title: 'Blog',
      path: '/blog'
  },
  {
      title:'Contact',
      path:'/contact'
  },
  {
      title:'Shop',
      path:'/shop'
  },
  {
      title:'Login',
      path:'/login'
  },
  {   title:'Create',
      path: '/create'
  }

]

function App() {
  return (
    <div>
      <RouterProvider router = {navLinks} />
    </div>
  );
}


export default App;
